import React from "react";
import classes from './NewTaskForm.module.css';

const NewTaskForm = props =>{

    return(
        <form>
            <div className={classes['new-task-inputs']}>
                <div className={classes['indv-input']}>
                    <label className={classes['sub-heading']}>Task Tile:</label>
                    <input  className={classes['title-input']} type='text' />
                </div>
                <div className={classes['indv-input']}>
                    <label className={classes['sub-heading']}>Task Description (optional):</label>
                    <textarea id="myTextarea" rows="7" cols="50"></textarea>
                </div>
            </div>
        </form>
    );
}

export default NewTaskForm;
